  \"2016-04-26T16:25:34.127523\",\n\t\"name\": \"building-and-safety-permit-information\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Building and Safety issues
  permits for the construction, remodeling, and repair of buildings and structures
  in the City of Los Angeles.  Permits are categorized into building permits, electrical
  permits, and mechanical permits (which include plumbing, HVAC systems, fire sprinklers,
  elevators, and pressure vessels).  Depending on the complexity of a project, a permit
  may be issued the same day with Express Permit or e-Permit (\"No Plan Check\" category),
  or a permit may require that the plans be reviewed (\"Plan Check\" category) by
  a Building and Safety Plan Check personnel.\",\n\t\"license_title\": \"License Not
